','default','Changes have been saved.','none'),(232,' inc/admin.inc:165','default','Settings were imported from the profile %name','none'),(233,' inc/admin.inc:178','default','Give a name to this profile.','none'),(234,' inc/admin.inc:187,  tpl/imce-content.tpl.php:44','default','Maximum file size per upload','none'),(235,' inc/admin.inc:189;196','default','Set to 0 to use the maximum value avaliable.','none'),(236,' inc/admin.inc:189','default','Your PHP settings limit the maximum file size per upload to %size.','none'),(237,' inc/admin.inc:190;197;204','default','MB','none'),(238,' inc/admin.inc:194','default','Directory quota','none'),(239,' inc/admin.inc:196','default','Define the upload quota per directory. Total user quota is proportional to the number of directories that the user has upload access to.','none'),(240,' inc/admin.inc:201','default','Total user quota','none'),(241,' inc/admin.inc:203','default','You can force total user quota to be a value independent of directory quota. <strong>This quota is calculated using the files table in the database, so that it will not include the files uploaded via FTP or by previous versions of IMCE(4.7.x and 5.x)</strong>. You can either use both quotations together or safely ignore this by setting the value to 0.','none'),(242,' inc/admin.inc:208,  tpl/imce-content.tpl.php:45','default','Permitted file extensions','none'),(243,' inc/admin.inc:211','default','Extensions that users in this role can upload. Separate extensions with a space and do not include the leading dot.','none'),(244,' inc/admin.inc:211','default','Set to * to remove the restriction.','none'),(245,' inc/admin.inc:215,  tpl/imce-content.tpl.php:46','default','Maximum image resolution','none'),(246,' inc/admin.inc:217','default','The maximum allowed image size (e.g. 640x480). Set to 0 for no restriction. If an <a href=\"!image-toolkit-link\">image toolkit</a> is installed, files exceeding this value will be scaled down to fit.','none'),(247,' inc/admin.inc:218','default','WIDTHxHEIGHT','none'),(248,' inc/admin.inc:222,  tpl/imce-content.tpl.php:47','default','Maximum number of files per operation','none'),(249,' inc/admin.inc:224','default','You can allow users to select multiple files for operations such as delete, resize, etc. Entire batch file operation is executed in a single drupal load, which may be good. However there will be an increase in script execution time, cpu load and memory consumption possibly exceeding the limits of your server, which is really bad. For unlimited number of file handling, set this to 0.','none'),(250,' inc/admin.inc:259','default','The changes have been saved.','none'),(251,' inc/admin.inc:259','default','Profile has been added.','none'),(252,' inc/admin.inc:286','default','Including subdirectories','none'),(253,' inc/admin.inc:291','default','Browse','none'),(254,' modules/upload.views.inc:25','default','Upload','none'),(255,' inc/admin.inc:301;407,  inc/page.inc:143;173','default','Thumbnails','none'),(256,' inc/admin.inc:311,  inc/js.inc:52,  inc/page.inc:159;215','default','Resize','none'),(257,' inc/admin.inc:340,  inc/subdir.inc:13','default','Directory path','none'),(258,' inc/admin.inc:342','default','Directories','none'),(259,' inc/admin.inc:344','default','Define directories that users of this profile can access.\n<ul>\n	<li>Use alphanumeric characters as directory paths.</li>\n	<li>To specify file system root, just enter <strong>.</strong>(dot) character.</li>\n	<li>Use <strong>%uid</strong> as a placeholder for user ID. Ex: <em>users/user%uid</em> creates directories such as <em>users/user1</em>, <em>users/user42</em>, etc.</li>\n  <li>To remove a directory from the list, leave the directory path blank.</li>\n  <li>If you want more flexibility in directory paths you can execute php to return a directory path.<br />\n  For php execution your directory path must start with <strong>php:</strong> and the rest must be a valid php code that is expected to return the actual directory path. <br />Ex: <strong>php: return \'users/\'.$user->name;</strong> defines <strong>users/USER-NAME</strong> as the directory path.<br />\n  A multi-level directory example <strong>php: return date(\'Y\', $user->created).\'/\'.date(\'m\', $user->created).\'/\'.$user->uid;</strong> defines <strong>MEMBERSHIP-YEAR/MONTH/USER-ID</strong> as the directory path, resulting in self-categorized user directories based on membership date.<br />\n  Note that you should use the $user variable instead of $GLOBALS[\'user\'] since they are not always the same object.</li>\n</ul>\n<p>Note that thumbnails permission does not affect thumbnail creation on upload. See thumbnails decription below.</p>\n<p>If you need more fields, just fill all and save, and you will get two more on the next page.</p>','none'),(260,' includes/admin.inc:262,  includes/plugins.inc:805,  modules/system.views.inc:69,  modules/user.views.inc:59;79','default','Name','none'),(261,' inc/admin.inc:395','default','Dimensions','none'),(262,' includes/field.handlers.inc:510','default','Prefix','none'),(263,' includes/field.handlers.inc:516','default','Suffix','none'),(264,' inc/admin.inc:409','default','You may create a list of thumbnail options that users can choose from.\n<ul>\n  <li>Use alphanumeric characters as thumbnail names.</li>\n  <li>Specify dimensions as <strong>WidthxHeight</strong>.</li>\n  <li>Prefix and suffix are strings that are added to original file name to create the thumbnail name.</li>\n  <li>An example thumbnail: Name = <strong>Small</strong>, Dimensions = <strong>80x80</strong>, Prefix = <strong>small_</strong></li>\n</ul>\n<p>Note that users will always be able to create thumbnails on file upload no matter what the thumbnail permission is. To disable thumbnail creation on file upload you should not define any thumbnails here.</p>\n<p>If you need more fields, just fill all and save, and you will get two more on the next page.</p>','none'),(265,' inc/admin.inc:456','default','Are