or file list: up, down, left, home, end, ctrl+A.','none'),(329,' tpl/imce-content.tpl.php:39','default','Keyboard shortcuts for selected files: enter/insert, delete, R(esize), T(humbnails), U(pload).','none'),(330,' tpl/imce-content.tpl.php:40','default','Keyboard shortcuts for directory list: up, down, left, right, home, end.','none'),(331,' tpl/imce-content.tpl.php:42','default','Limitations','none'),(332,' tpl/imce-content.tpl.php:45','default','all','none'),(333,' tpl/imce-content.tpl.php:62','default','Navigation','none'),(334,' tpl/imce-content.tpl.php:72','default','File name','none'),(335,' modules/system.views.inc:126','default','Size','none'),(336,' plugins/layouts/flexible/flexible.inc:793;1077','default','Width','none'),(337,' tpl/imce-content.tpl.php:75','default','Height','none'),(338,' tpl/imce-content.tpl.php:76','default','Date','none'),(339,' tpl/imce-content.tpl.php:84','default','!num files using !dirsize of !quota','none'),(340,' tpl/imce-content.tpl.php:87','default','unlimited quota','none'),(341,' tpl/imce-content.tpl.php:105','default','Clear log','none'),(342,' tpl/imce-page.tpl.php:7','default','File Browser','none'),(343,' includes/view.inc:946','default','Home','none'),(344,' content.module:25','default','The content module, a required component of the Content Construction Kit (CCK), allows administrators to associate custom fields with content types. In Drupal, content types are used to define the characteristics of a post, including the title and description of the fields displayed on its add and edit pages. Using the content module (and the other helper modules included in CCK), custom fields beyond the default \"Title\" and \"Body\" may be added. CCK features are accessible through tabs on the <a href=\"@content-types\">content types administration page</a>. (See the <a href=\"@node-help\">node module help page</a> for more information about content types.)','none'),(345,' content.module:26','default','When adding a custom field to a content type, you determine its type (whether it will contain text, numbers, or references to other objects) and how it will be displayed (either as a text field or area, a select box, checkbox, radio button, or autocompleting field). A field may have multiple values (i.e., a \"person\" may have multiple e-mail addresses) or a single value (i.e., an \"employee\" has a single employee identification number). As you add and edit fields, CCK automatically adjusts the structure of the database as necessary. CCK also provides a number of other features, including intelligent caching for your custom data, an import and export facility for content type definitions, and integration with other contributed modules.','none'),(346,' content.module:27','default','Custom field types are provided by a set of optional modules included with CCK (each module provides a different type). The <a href=\"@modules\">modules page</a> allows you to enable or disable CCK components. A default installation of CCK includes:','none'),(347,' content.module:29','default','<em>number</em>, which adds numeric field types, in integer, decimal or floating point form. You may define a set of allowed inputs, or specify an allowable range of values. A variety of common formats for displaying numeric data are available.','none'),(348,' content.module:30','default','<em>text</em>, which adds text field types. A text field may contain plain text only, or optionally, may use Drupal\'s input format filters to securely manage rich text input. Text input fields may be either a single line (text field), multiple lines (text area), or for greater input control, a select box, checkbox, or radio buttons. If desired, CCK can validate the input to a set of allowed values.','none'),(349,' content.module:31','default','<em>nodereference</em>, which creates custom references between Drupal nodes. By adding a <em>nodereference</em> field and two different content types, for instance, you can easily create complex parent/child relationships between data (multiple \"employee\" nodes may contain a <em>nodereference</em> field linking to an \"employer\" node).','none'),(350,' content.module:32','default','<em>userreference</em>, which creates custom references to your sites\' user accounts. By adding a <em>userreference</em> field, you can create complex relationships between your site\'s users and posts. To track user involvement in a post beyond Drupal\'s standard <em>Authored by</em> field, for instance, add a <em>userreference</em> field named \"Edited by\" to a content type to store a link to an editor\'s user account page.','none'),(351,' content.module:33','default','<em>fieldgroup</em>, which creates collapsible fieldsets to hold a group of related fields. A fieldset may either be open or closed by default. The order of your fieldsets, and the order of fields within a fieldset, is managed via a drag-and-drop interface provided by content module.','none'),(352,' content.module:35','default','For more information, see the online handbook entry for <a href=\"@handbook-cck\">CCK</a> or the <a href=\"@project-cck\">CCK project page</a>.','none'),(353,' content.module:474','default','This field is required.','none'),(354,' content.module:478','default','!title: !required','none'),(355,' includes/admin.inc:274','default','Order','none'),(785,' content.module:1640','default','RSS Item','none'),(356,' views_ui.module:52','default','Basic','none'),(357,' modules/node.views.inc:363','default','Teaser','none'),(358,' content.module:1636 modules/nodereference/nodereference.module:210','default','Full node','none'),(359,' content.module:1881;1884','default','RSS','none'),(360,' modules/search.views.inc:23;77;88;106;172;247','default','Search','none'),(361,' content.module:1642','default','Search Index','none'),(362,' content.module:1643','default','Search Result','none'),(363,' content.module:2349;2356','default','Node module form.','none'),(364,' modules/node.views.inc:248;1115','default',