INSERT INTO `locales_target` VALUES (24,'Habilitar mdulos de desarrollador','es',0,0),(25,'Deshabilitar mdulos de desarrollados','es',0,0),(26,'Ajustar magen superior','es',0,0),(27,'Si est habilitado, la salida del sitio ser desplazada aproximadamente 20 pixeles hacia abajo para mostrar el men de administracin. Si est deshabilitado, algn elemento de posicin absoluta o fija en la pgina, puede ser cubierto por el men de administracin.','es',0,0),(28,'Mantener men en la parte superior de la pgina','es',0,0),(29,'Si est habilitado, el men de administracin siempre ser mostrado en la parte superior de la vista del navegador (el resto de la pgina ser desplazada). <strong>Importante: En algunos navegadores, esta opcin puede ocasionar una pgina malformada, un cursor invisible, elementos no seleccionables en los formularios, y otras consecuencias. Deshabilite este opcin si algo de esto ocurre.</strong>','es',0,0),(30,'Opciones avanzadas','es',0,0),(31,'Colapsar campos en la pgina de mdulos','es',0,0),(32,'Si est habilitado, los campos en la <a href=\"!modules-url\">pgina de modulos</a> son automticamente colapsados cuando carga la pgina.','es',0,0),(33,'Si el mdulo Utility fue instalado para este propsito, puede ser deshabilitado y desinstalado en forma segura.','es',0,0),(34,'Mover tareas locales dentro del men','es',0,0),(35,'Si est habilitado, las tabs en la pgina actual sern movidas dentro del men de administracin. Esta caracterstica slo est disponible en los temas que usen las clases CSS <code>tabs primary</code> y <code>tabs secondary</code> para las tabs.','es',0,0),(36,'Si el men de administracin muestra items duplicados, necesita reconstruir sus items usando el botn <em>Borrar y rearmar</em>.','es',0,0),(37,'Borrar y rearmar','es',0,0),(38,'Opciones del men de administracin','es',0,0),(39,'Ninguno','es',0,0),(40,'ID enlace del men','es',0,0),(41,'Peso','es',0,0),(42,'ID enlace del padre','es',0,0),(43,'Mostrar datos adicionales para cada item del men','es',0,0),(44,