cin</em> (mdulo admin_menu). Segundo, un usuario debe ser miembro de un rol con el permiso de <em>Acceder a las pginas de administracin</em> (mdulo system) y los enlaces administrativos. Y tercero, slo los enlaces permitidos sern mostrados, por ejemplo, si un usuario no es miembro de un rol con los permisos <em>Permisos de administracin</em> (mdulo user) y <em>Administrar usuarios</em> (mdulo user), el item del men <em>Gestin de usuarios</em> no ser mostrado.','es',0,0),(54,'Usuarios anninos/registrados  actuales','es',0,0),(55,'@count-anon / @count-auth !icon','es',0,0),(56,'Acceso a men de administracin','es',0,0),(57,'Mostrar enlaces de Drupal','es',0,0),(58,'Men de administracin','es',0,0),(59,'Ajustar opciones del men de administracin.','es',0,0),(60,'admin_menu','es',0,0),(61,'Provee un men desplegable para la mayora de las tareas administrativas y otros destinos comunes (para los usuarios con los permisos apropiados).','es',0,0),(62,'Administracin','es',0,0),(63,'Longitud mxima','es',0,0),(64,'La longitud mxima del campo en caracteres. Djalo en blanco para un tamao ilimitado.','es',0,0),(65,'es igual a','es',0,0),(66,'no es igual a','es',0,0),(67,'coincide con el patrn','es',0,0),(68,'Valor ilegal para %name.','es',0,0),(69,'Filas','es',0,0),(70,'\"Filas\" debe ser un valor positivo entero.','es',0,0),(71,'duplicar','es',0,0),(72,'Valores permitidos','es',0,0),(73,'Los valores posibles que este campo puede contener. Cualquier otro valor puede dar error. Ingresar un valor por linea.','es',0,0),(74,'Permitir a los administradores definir nuevos tipos de contenidos.','es',0,0),(75,'aadir un tipo de contenido','es',0,0),(76,'los campos','es',0,0),(77,'configurar los campos','es',0,0),(78,'borrar el campo','es',0,0),(79,'Define un tipo de campo para referenciar un nodo de otro. <em>Nota: Requiere content.module.</em>','es',0,0),(80,'autocompletar nodo de referencia','es',0,0),(81,'Tipos de contenido que pueden ser referenciados','es',0,0),(82,'No existe ninguna pu