a se calcular usando la tabla de documentos de la base de datos, por lo que no se incluirn aquellos documentos que se hayan subido con FTP o con versiones anteriores de IMCE (4.7.x y 5.x). Puede usar ambas restricciones juntas o, de forma ms segura, dejar este valor en 0.','es',0,0),(242,'Extensiones de archivos permitidas','es',0,0),(243,'Las extensiones que los usuarios de este rol pueden cargar. Las extensiones se deben separar con un espacio y no deben incluir el punto inicial.','es',0,0),(244,'Ponga * para eliminar las restricciones.','es',0,0),(245,'Resolucin mxima de la imagen','es',0,0),(246,'El tamao mximo permitido para las imgenes; por ejemplo: 640  480. Djelo en 0 si no quiere limitarlo. Si tiene instalado algn juego de <a href=\"!image-toolkit-link\">herramientas de imagen</a>, las imgenes que excedan esas dimensiones se reducirn para ajustarse.','es',0,0),(247,'ANCHO  ALTO','es',0,0),(248,'Nmero mximo de documentos por operacin','es',0,0),(249,'Puede permitir que los usuarios selecciones varios documentos para operaciones como borrar, redimensionar, etc... Cada operacin multiple se ejecutar con una sla carga de Drupal, lo que puede ser bueno. Sin embargo, habr un aumento en la ejecucin de la secuencia de rdenes, de carga de la CPU y de consumo de memoria. Esto podra superar los lmites del servidor, <strong>lo que es realmente malo.</strong> Para disponer un nmero ilimitado de documentos, deje el valor en 0.','es',0,0),(250,'Se han guardado los cambios.','es',0,0),(251,'El perfil se ha aadido.','es',0,0),(252,'Incluyendo subdirectorios','es',0,0),(253,'Explorar','es',0,0),(254,'Upload','es',0,0),(255,'Miniaturas','es',0,0),(256,'Redimensionar','es',0,0),(257,'Ruta del directorio','es',0,0),(258,'Directorios','es',0,0),(259,'Defina directorios a los que los usuarios con este perfil pueden acceder.\n<ul>\n	<li>Use slo caracteres alfanumricos como rutas de los directorios.</li>\n	<li>Para especificar la la raiz del sistema Drupal, use un caracter (.) de punto.</li>\n	<li>Utilice <em>%uid</strong> como contenedor de la ID de usuario; por ejemplo: <em>users/user%uid</em> crear directorios como <em>users/user1</em>, <em>users/user42</em>, etc...</li>\n<li>Para eliminar un directorio de la lista, deje su ruta en blanco.</li>\n<li>Si quiere una mayor flexibilidad en las rutas de los directorios, use PHP para obtener una ruta de diectorio.<br />\nPara ese uso de PHP, su directorio debe comenzar con <em>php:</em> y el resto debe ser una cadena de PHP vlida, de la que se espere que devuelva la ruta actual del directorio.<br />Por ejemplo: <em>php: return \'users/\'.$user->name;</em> define como ruta del directorio <em>users/USER-NAME</em><br />\nUn ejemplo de directorio multinivel: <em>php: return date(\'Y\', $user->created).\'/\'.date(\'m\', $user->created).\'/\'.$user->uid;</em> define <em>MEMBERSHIP-YEAR/MONTH/USER-ID</em> como ruta del directorio, lo que resultar en directorios de usuario categorizados sobre la base de la fecha de inscripcin como usuarios.<br />\nTenga en cuenta que debera usar la variable <em>$user</em> en vez de <em>$GLOBALS[\'user\']</em> ya que no siempre son el mismo objeto.</li>\n</ul>\n<p>Tenga tambin presente que los permisos de miniaturas no afectan a la creacin de miniaturas al subir archivos. Consulte la creacin de miniaturas ms adelante.</p>\n<p>Si necesita ms campos, escrba y guarde. Tendr dos ms en la pgina siguiente.</p>','es',0,0),(260,'Nombre','es',0,0),(261,'Dimensiones','es',0,0),(262,'Prefijo','es',0,0),(263,'Sufijo','es',0,0),(264,'Puede crear una lista de opciones de miniaturas para que los usuarios elijan.\n<ul>\n  <li>Use slo caracteres alfanumricos como nombres de miniaturas.</li>\n  <li>Especifique las dimensiones de forma Ancho  Alto.</li>\n  <li>Los prefijos y sufijos son textos que se aaden al nombre de cada documento para crear el de la correspondiente miniatura.</li>\n  <li>Un ejemplo de miniatura es: Nombre = <em>Pequeno</em>, Dimensiones = <em>80  80</em>, Prefijo = <em>mini_</em></li>\n</ul>\n<p>Tenga en cuenta que los usuarios siempre podrn crear miniaturas al subir documentos. sin importa cul sea el permiso de miniaturas. Para desactivar la creacin de miniaturas al subir documentos, lo que debe hacer es no definir aqu miniaturas.</p>\n<p>Si necesita ms campos, escrba y guarde. Tendr dos ms en la pgina siguiente.</p>','es',0,0),(265,'Est seguro de querer borrar el perfil %name?','es',0,0),(266,'Cancelar','es',0,0),(267,'El perfil se ha borrado.','es',0,0),(268,'ninguno','es',0,0),(269,'Importar opciones de configuracin de otros perfiles','es',0,0),(270,'las rutas de directorio duplicadas no se permiten.','es',0,0),(271,'%dirnameno es aceptable como nombre de directorio.','es',0,0),(272,'Crear miniaturas','es',0,0),(273,'Archivo','es',0,0),(274,'Subir fichero','es',0,0),(275,'Documentos seleccionados','es',0,0),(276,'Ancho  alto','es',0,0),(277,'Crear imagen nueva','es',0,0),(278,'Seleccione un documento, por favor.','es',0,0),(279,'No tiene permiso para actuar sobre ms de %num documentos.','es',0,0),(280,'directorio (%dir)','es',0,0),(281,'Se detect una seleccin ilegal. Por favor pngase en contacto con el administrador del sitio.','es',0,0),(282,'El documento se ha renombrado %filename.','es',0,0),(283,'%filename se ha copiado al servidor.','es',0,0),(284,'La subida no se pudo efectuar.','es',0,0),(285,'Documentos borrados satisfactoriamente: %files.','es',0,0),(286,'Especifique unas dimensiones dentro de las permitidas, por favor. Eso va desde 1  1 a @dimensions.','es',0,0),(287,'sin lmite','es',0,0),(288,'Redimensionado de documento(s) realizado satisfactoriamente: %files.','es',0,0),(289,'Creacin de miniatura(s) (%thumbnames) satisfactoria para %filename.','es',0,0),(290,'%filename no es una imagen.','es',0,0),(291,'El aumento de tamao no se permite.','es',0,0),(292,'El documento %filename (%dimensions) ya existe.','es',0,0),(293,'El documento %filename no se puede redimensionar a %dimensions','es',0,0),(294,'El archivo %file s