tion.</em>','fr',0,0),(47,'Vous avez activ ces modules : !module-list.','fr',0,0),(48,'Vous avez dsactiv ces modules : !module-list.','fr',0,0),(49,'Aucun module de dveloppeur n\'est activ.','fr',0,0),(50,'Le module de menu d\'administration fournit un menu droulant, arrang pour l\'accs en un ou deux clics  la plupart des tches administratives, et  d\'autres destinations communes (pour les utilisateurs aux permissions appropries). Utilisez les paramtres ci-dessous pour personnaliser l\'apparence du menu. ','fr',0,0),(51,'Le module de menu d\'administration fournit un menu droulant, arrang pour l\'accs en un ou deux clics  la plupart des tches administratives, et  d\'autres destinations communes (pour les utilisateurs aux permissions appropries). Le menu d\'administration affiche aussi le nombre d\'utilisateurs anonymes et authentifis, et permet aux modules d\'ajouter leurs propres lments de menu personnaliss. L\'intgration dans le menu varie selon le module; Par exemple, le module contribu <a href=\"@drupal\">Devel</a> utilise fortement le module de menu d\'administration pour fournir un accs rapide aux outils de dveloppement.','fr',0,0),(52,'La <a href=\"@settings\">page de paramtres</a> du module d\'administration vous permet de modifier certains lments de comportement et d\'apparence du menu. Puisque l\'apparence du menu est dpendante du thme de votre site, des personnalisations substantielles requirent des modifications aux fichiers CSS et de thme de votre site. Voir le fichier de module avanc README.txt pour plus d\'informations sur les personnalisations de thme et de CSS.','fr',0,0),(53,'Les lments de menu affichs dans le menu d\'administration dpendent des permissions relles de l\'utilisateur. Premirement, le menu d\'administration n\'est affich que pour les utilisateurs aux rles possdant la permission <em>Accder au menu d\'administration</em> (module admin_menu). Deuximement, un utilisateur doit tre membre d\'un rle possdant la permission  <em>Accder aux pages d\'administration</em> (module system), afin de voir les liens d\'administration. Enfin, troisimement, seuls les liens rellement autoriss sont affichs. Par exemple, si un utilisateur n\'est pas membre d\'un rle possdant la permission <em>Administrer les permissions</em> (module user), l\'lment de menu <em>Gestion des utilisateurs</em> n\'est pas affich.','fr',0,0),(54,'Utilisateurs anonymes / authentifis actuels','fr',0,0),(55,'@count-anon / @count-auth !icon','fr',0,0),(343,'Accueil','fr',0,0),(56,'accder au menu d\'administration','fr',0,0),(57,'afficher les liens drupal','fr',0,0),(58,'Menu d\'administration','fr',0,0),(59,'Ajuster les paramtres du menu d\'administration','fr',0,0),(60,'admin_menu','fr',0,0),(61,'Fournit un menu droulant pour les tches administratives les plus courantes, et pour d\'autres destinations usuelles (pour les utilisateurs possdant les permissions appropries).','fr',0,0),(62,'Administration','fr',0,0),(344,'Le module Content, composant obligatoire du kit CCK (Content Construction Kit) permet aux administrateurs d\'associer des champs personnaliss  des types de contenus. Au sein de Drupal, les types de contenus servent  dfinir les caractristiques d\'une publication, y compris le titre et la description des champs affichs sur ses pages \"ajouter\" et \"diter\". Le module Content (et les modules auxiliaires inclus dans CCK) permet d\'ajouter des champs personnaliss en plus des champs par dfaut \"Titre\" et \"Corps\". Les fonctionnalits de CCK sont accessible via diffrents onglets sur la <a href=\"@content-types\">page d\'administration des types de contenus</a>. (Voir la <a href=\"@node-help\">page d\'aide du module Node</a> pour plus d\'informations sur les types de contenus).','fr',0,0),(345,'Lorsque vous ajoutez un champ personnalis  un type de contenu, vous dterminez son type (c\'est--dire s\'il doit contenir du texte, des nombres ou des rfrences  d\'autres objets) et la faon dont il doit tre affich (en tant que champ ou zone de texte, liste de slection, case  cocher, bouton radio, ou champ  auto-compltement). Un champ peut prsenter plusieurs valeurs (par exemple, une \"personne\" peut disposer de plusieurs adresses e-mail) ou une seule (par exemple, un \"employ\" possde un numro d\'identification unique).  mesure que vous ajoutez et modifiez des champs, CCK ajuste automatiquement la structure de la base de donnes en fonction. CCK propose galement un certain nombre d\'autres fonctionnalits, par exemple un cache intelligent pour vos donnes personnalises, des fonctionnalits d\'import et d\'export pour les dfinitions de types de contenus, ainsi qu\'une intgration  d\'autres modules provenant des contributions.','fr',0,0),(346,'Des types de champs personnaliss sont proposs par plusieurs modules optionnels inclus dans CCK (chaque module fournissant un type diffrent). La <a href=\"@modules\">page des modules</a> vous permet d\'activer ou de dsactiver des composants CCK. Une installation par dfaut de CCK inclut:','fr',0,0),(347,'<em>Number</em>, qui ajoute des types de champs numriques (formats entier, dcimal ou rel  virgule flottante). Vous pouvez dfinir un jeu ou un intervalle de valeurs autorises. Divers formats sont disponibles pour l\'affichage des donnes numriques.','fr',0,0),(348,'<em>Text</em>, qui ajoute des types de champs de texte. Un champ texte peut contenir du texte brut uniquement ou, optionnellement, utiliser les filtres des formats d\'entre que propose Drupal pour grer en toute scurit des textes enrichis. Les champs de saisie de texte peuvent tre constitus d\'une seule ligne (champ texte), de plusieurs lignes (zone de texte) ou, pour un meilleur contrle des valeurs saisies, une liste de slection, des cases  cocher ou des boutons radio. Si besoin, CCK peut valider les saisies sur la base d\'un ensemble de valeurs autorises.','fr',0,0),(349,'<em>Node Reference</em>, qui cre des rfrences personnalises entre nuds de Drupal. En ajoutant, par exemple, un champ <em>nodereference</em> et deux types de contenus diffrents, vous pouvez facilement crer des relations complexes de type parent/enfant entre donnes (par exemple plusieurs nuds \"employ\" peuvent prsenter un champ <em>nodereference</em> pointant vers un mme nud \"employeur\").','fr',0,0),(350,'<em>User reference</em>, qui cre des rfrences personnalises vers les comptes des utilisateurs de votre site. En ajoutant un champ <em>userreference</em>, vous pouvez crer des relations complexes entre les utilisateurs de votre site et des publications. Ainsi, pour tracer l\'implication d\'un utilisateur dans une publication (au del du champ Drupal standard <em>crit par</em>), vous pouvez ajouter  un type de contenu un champ <em>userreference</em> intitul \"dit par\" pour enregistrer un lien vers la page du compte utilisateur ayant dit la publication.','fr',0,0),(351,'<em>Fieldgroup</em>, qui cre des groupes de champs lis. Les groupes de champ peuvent tre replis, et vous pouvez choisir qu\'ils soient dplis ou replis par dfaut. L\'ordre des groupes de champs, ainsi que l\'ordre des champs au sein d\'un groupe, est gr grce  l\'interface par glisser-dposer fournie par le module Content.','fr',0,0),(352,'Pour plus d\'informations, reportez-vous  l\'entre de manuel en ligne relative  <a href=\"@handbook-cck\">CCK</a> ou  la <a href=\"@project-cck\">page du projet CCK</a>.','fr',0,0),(353,'Ce champ est obligatoire.','fr',0,0),(354,'!title: !required','fr',0,0),(355,'Ordre','fr',0,0),(129,'ter','fr',0,0),(356,'Basique','fr',0,0),(357,'Rsum','fr',0,0),(358,'Nud complet','fr',0,0),(359,'RSS','fr',0,0),(360,'Recherche','fr',0,0),(361,'Index de recherche','fr',0,0),(362,'Rsultat de recherche','fr',0,0),(363,'Formulaire du module node.','fr',0,0),(364,'Langue','fr',0,0),(365,'Formulaire du module locale.','fr',0,0),(366,'Paramtres du menu','fr',0,0),(367,'Formulaire du module menu.','fr',0,0),(368,'Taxonomie','fr',0,0),(369,'Formulaire du module taxonomy.','fr',0,0),(370,'Livre','fr',0,0),(371,'Formulaire du module livr