INSERT INTO `node_revisions` VALUES (1,1,1,'Access london incognito network','<p>Access london incognito network</p>','<p>Access london incognito network</p>','',1286219667,4),(2,2,1,'About us','<p>About us</p>','<p>About us</p>','',1286220496,3),(3,3,1,'Why london incognito','<p>Londo incognito home page</p>\r\n<ul>\r\n    <li class=\"originalite\"><b>The freedom</b> :<br />\r\n    Visit London freely and enjoy full autonomy, while being organised.</li>\r\n    <li class=\"originalite\"><b>The originality</b> :<br />\r\n    Feel like travelling differently, or have a lack of inspiration&nbsp;? London  Incognito proposes themed day trips, custom built in order for you to  realise your most unusual travel dreams&hellip; Once your thematic day has been  chosen, London Incognito&rsquo;s details will make all the difference.</li>\r\n    <li class=\"choix\"><b>The choice</b> :<br />\r\n    &quot;With the &quot;<a target=\"_self\" href=\"http://www.london-incognito.com/en/Packages/a-la-carte-day-trip\">&agrave; la carte</a> &quot; choice, you can participate in the organisation of your day, get  inspired by selecting activities, include your own ideas and special  requests, whilst relying on professionals to provide the finishing  touches and complete all the arrangements for your day.</li>\r\n    <li class=\"tranquilite\"><b>Peace of mind</b> :<br />\r\n    Having your day organised by London Incognito allows you to leave the tedious tasks behind.</li>\r\n    <li class=\"gain-temps\"><b>Time saving</b> :<br />\r\n    Before and during your trip&nbsp;: London Incognito ensures you will fully  enjoy your stay by saving you time on organisation, decisions and the  sequence of your day&nbsp;!</li>\r\n    <li class=\"rassurance\"><b>The reassurance</b> :<br />\r\n    Don&rsquo;t worry about the language barrier, London Incognito takes  responsibility for bookings, and delivers you a programme and a  custom-built itinerary.</li>\r\n</ul>','<p>Londo incognito home page</p>','',1286728784,3),(4,4,1,'Partners','<div id=\"folder\" class=\"partners\" style=\"background: url(&quot;/var/london/storage/images/partenaires/609-17-eng-GB/Partners.jpg&quot;) no-repeat scroll 0% 0% transparent;\">\r\n<div class=\"description\">\r\n<p class=\" text-justify\">Home page picture from Michelle Houston, Amelia Prazak, Harriet Wilcox and Hannah Dolan.<br />\r\nProject: &quot;tea...&quot; Course of Design for performance and Practice at Central Saint Martins.</p>\r\n<p class=\" text-justify\">Pictures and logo from: <a href=\"http://marionasala.blogspot.com/\" target=\"_blank\">Mariona Sala de Buen</a> &nbsp;(m.saladebuen@googlemail.com).</p>\r\n<p class=\" text-justify\">Website&nbsp;built by Johann Reinke : <a href=\"http://www.doyoubuzz.com/johann-reinke\" target=\"_blank\">http://www.doyoubuzz.com/johann-reinke</a></p>\r\n<p class=\" text-justify\">---------------</p>\r\n<p>Meet your friend at the other end with <a href=\"http://www.tripbod.com/\" target=\"_blank\">Tripbod</a> , a trusted local person who can help you plan your trip!</p>\r\n<p>---------------</p>\r\n<p>Discover a selection of the best and latest addresses of the moment in the big metropolises with <a href=\"http://www.mercipourladresse.com/\" target=\"_blank\">www.mercipourladresse.com</a></p>\r\n<p>---------------</p>\r\n<p>Visit Paris differently with&nbsp;<a href=\"http://www.quiveutpisterparis.com/\" target=\"_blank\">www.quiveutpisterparis.com</a> &nbsp;through a paper chase!</p>\r\n<p>----------------</p>\r\n<p>Experience a new city with a local friend anywhere in the world with&nbsp;<a href=\"http://www.rentalocalfriend.com/\" target=\"_blank\">www.rentalocalfriend.com</a></p>\r\n</div>\r\n</div>','<div id=\"folder\" class=\"partners\" style=\"background: url(&quot;/var/london/storage/images/partenaires/609-17-eng-GB/Partners.jpg&quot;) no-repeat scroll 0% 0% transparent;\">\r\n<div class=\"description\">\r\n<p class=\" text-justify\">Home page picture from Michelle Houston, Amelia Prazak, Harriet Wilcox and Hannah Dolan.<br />\r\nProject: &quot;tea...&quot; Course of Design for performance and Practice at Central Saint Martins.</p>','',1286726540,3),(5,5,1,'Getting here','<div style=\"background: url(&quot;/var/london/storage/images/partenaires/609-17-eng-GB/Partners.jpg&quot;) no-repeat scroll 0% 0% transparent;\" class=\"partners\" id=\"folder\">\r\n<div class=\"description\">\r\n<p class=\" text-justify\">Home page picture from Michelle Houston, Amelia Prazak, Harriet Wilcox and Hannah Dolan.<br />\r\nProject: &quot;tea...&quot; Course of Design for performance and Practice at Central Saint Martins.</p>\r\n<p class=\" text-justify\">Pictures and logo from: <a target=\"_blank\" href=\"http://marionasala.blogspot.com/\">Mariona Sala de Buen</a> &nbsp;(m.saladebuen@googlemail.com).</p>\r\n<p class=\" text-justify\">Website&nbsp;built by Johann Reinke : <a target=\"_blank\" href=\"http://www.doyoubuzz.com/johann-reinke\">http://www.doyoubuzz.com/johann-reinke</a></p>\r\n<p class=\" text-justify\">---------------</p>\r\n<p>Meet your friend at the other end with <a target=\"_blank\" href=\"http://www.tripbod.com/\">Tripbod</a> , a trusted local person who can help you plan your trip!</p>\r\n<p>---------------</p>\r\n<p>Discover a selection of the best and latest addresses of the moment in the big metropolises with <a target=\"_blank\" href=\"http://www.mercipourladresse.com/\">www.mercipourladresse.com</a></p>\r\n<p>---------------</p>\r\n<p>Visit Paris differently with&nbsp;<a target=\"_blank\" href=\"http://www.quiveutpisterparis.com/\">www.quiveutpisterparis.com</a> &nbsp;through a paper chase!</p>\r\n<p>----------------</p>\r\n<p>Experience a new city with a local friend anywhere in the world with&nbsp;<a target=\"_blank\" href=\"http://www.rentalocalfriend.com/\">www.rentalocalfriend.com</a></p>\r\n</div>\r\n</div>','<div style=\"background: url(&quot;/var/london/storage/images/partenaires/609-17-eng-GB/Partners.jpg&quot;) no-repeat scroll 0% 0% transparent;\" class=\"partners\" id=\"folder\">\r\n<div class=\"description\">\r\n<p class=\" text-justify\">Home page picture from Michelle Houston, Amelia Prazak, Harriet Wilcox and Hannah Dolan.<br />\r\nProject: &quot;tea...&quot; Course of Design for performance and Practice at Central Saint Martins.</p>','',1286728731,3),(6,6,1,'Me & London Incognito','<div style=\"background: url(&quot;/var/london/storage/images/moi-london-incognito/543-15-eng-GB/Me-London-Incognito.jpg&quot;) no-repeat scroll 0% 0% transparent;\" class=\"me-london-incognito\" id=\"folder\">\r\n<div class=\"description\">\r\n<p class=\" text-justify\">&laquo;&nbsp;Happiness is only real when shared&nbsp;&raquo;&hellip;&nbsp;Travelling is part of it and for me it&rsquo;s here that everything started&hellip;</p>\r\n<p class=\" text-justify\">Travelling is discovering, sharing, learning,  dreaming and escaping&hellip;but also enjoying and appreciating the town like a  local. It means understanding the culture, pacing up and down streets  until knowing the merest corner, tiniest parks and the most unlikely  museums. It is this quest for secret, hidden,&nbsp;unusual and  INCOGNITO&nbsp;places, far from tourists and off the beaten track that  attracts me particularly! That is what I would like to share with you in  London, my last destination.</p>\r\n<p class=\" text-justify\">London Incognito will show you London through the eyes of a local, through a variety of <a target=\"_self\" href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built\">themed day trips</a>  that I have imagined for you. Far from the crowd and clich&eacute;, we will  discover the secret, hidden treasures London still has in store for us.</p>\r\n<p class=\" text-justify\">In order to satisfy your trip as much as possible, I also wish to give you the opportunity to create your own adventure &ldquo;<a target=\"_self\" href=\"http://www.london-incognito.com/en/Packages/a-la-carte-day-trip\">A la carte</a> &rdquo; from a variety of activities.</p>\r\n<p class=\" text-justify\">I am sure this concept will appeal to you and can interest you travelling in a different way.</p>\r\n<p class=\" text-justify\">Don&rsquo;t spend your time in London waiting in  queues, and missing out on the best it has to offer, follow me and  become a local London (tourist)!</p>\r\n<p class=\" text-right\">Julie Miquerol</p>\r\n</div>\r\n</div>','<div style=\"background: url(&quot;/var/london/storage/images/moi-london-incognito/543-15-eng-GB/Me-London-Incognito.jpg&quot;) no-repeat scroll 0% 0% transparent;\" class=\"me-london-incognito\" id=\"folder\">\r\n<div class=\"description\">\r\n<p class=\" text-justify\">&laquo;&nbsp;Happiness is only real when shared&nbsp;&raquo;&hellip;&nbsp;Travelling is part of it and for me it&rsquo;s here that everything started&hellip;</p>','',1286728886,3),(7,7,1,'Packages','<div style=\"background: url(&quot;/var/london/storage/images/formules/561-10-eng-GB/Packages.jpg&quot;) no-repeat scroll 0% 0% transparent;\" class=\"packages\" id=\"folder\">\r\n<ul class=\"children\">\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built\">Themed day trip imaginated custom built</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/a-la-carte-day-trip\">&laquo;&nbsp;&agrave; la carte&nbsp;&raquo; day trip</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Gift-idea\">Gift idea</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Accommodation-bookings\">Accommodation bookings</a></li>\r\n</ul>\r\n</div>','<div style=\"background: url(&quot;/var/london/storage/images/formules/561-10-eng-GB/Packages.jpg&quot;) no-repeat scroll 0% 0% transparent;\" class=\"packages\" id=\"folder\">\r\n<ul class=\"children\">\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built\">Themed day trip imaginated custom built</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/a-la-carte-day-trip\">&laquo;&nbsp;&agrave; la carte&nbsp;&raquo; day trip</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Gift-idea\">Gift idea</a></li>\r','',1286729152,3),(8,8,1,'Themed day trip','<div id=\"folder\" class=\"themed-day-trip\">\r\n<div class=\"description\">\r\n<p class=\" text-justify\">London Incognito will provide custom-built,  themed day trips to include original activities, unusual visits, trips  off the beaten track with your family, friends, partner or on your own.  Travel differently by choosing a day trip that suits you.</p>\r\n<p class=\" text-justify\">Please note, these may change depending on the  season, the weather, our providers etc&hellip;But also according to your  particular demands. Therefore, a quotation of the above trip will be  issued upon request.</p>\r\n<div class=\" pdf-cgv\"><img width=\"16\" height=\"16\" src=\"http://www.london-incognito.com/share/icons/crystal/16x16/mimetypes/pdf.png\" alt=\"\" title=\"\" />&nbsp;<a href=\"http://www.london-incognito.com/en/content/download/88/1196/file/General%20terms%20of%20trade.pdf\">General terms of trade.pdf</a></div>\r\n</div>\r\n<ul class=\"children\">\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/Play-Sherlock-Holmes\">Play Sherlock Holmes</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/London-by-the-waterside\">London by the waterside</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/London-for-children\">London for children</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/Londoner-for-a-day\">Londoner for a day</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/Keep-you-figure-before-2012\">Keep you figure before 2012!</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/An-artist-in-London\">An artist in London</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/Vintage-London\">Vintage London</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/London-lovers\">London lovers</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/Rock-n-punk-London\">Rock n&rsquo; punk London</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/London-back-in-time\">London back in time</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/Live-like-a-Queen\">Live like a Queen</a></li>\r\n    <li><a href=\"http://www.london-incognito.com/en/Packages/Themed-day-trip-imaginated-custom-built/An-alternative-London-night\">An alternative London night</a></li>\r\n</ul>\r\n</div>','<div id=\"folder\" class=\"themed-day-trip\">\r\n<div class=\"description\">\r\n<p class=\" text-justify\">London Incognito will provide custom-built,  themed day trips to include original activities, unusual visits, trips  off the beaten track with your family, friends, partner or on your own.  Travel differently by choosing a day trip that suits you.</p>\r\n<p class=\" text-justify\">Please note, these may change depending on the  season, the weather, our providers etc&hellip;But also according to your  particular demands. Therefore, a quotation of the above trip will be  issued upon request.</p>','',1286729484,3);
